.text
main:		lui $9, 0x1001   			#Registrador $9 guarda endereço
		addi $10, $0, 8192			#Registrador $10 guarda o resultado do seguinte cálculo: (512/4) x (256/4)
		addi $11, $0, 27808			#Posição da nave
		addi $12, $0, 5180			#Posição do alien	
		addi $14, $0, 5580			#Posição limite do alien
		

for:		beq $10, $0, start			#Label 'for' para criação do cenário
		lw $8, 0($9)
		sw $8, 0($9)
		addi $9, $9, 4		
		addi $10, $10, -1		
		j for
		
start:		bne $0, $0, fim
		.include "NAVE.asm"			#O arquivo irá desenhar a nave que está no reg $11
		.include "ALIEN1.asm"			#O arquivo irá desenhar e apagar o alien que está no reg $12
		beq $21, $12, perdeu			#Tentativa de desenvolver condição para que o alien morresse. Reg $21 guardaria a posição do tiro
		beq $12, $14, alien_posição		#Confere se reg $12 atingiu o valor limite que está no reg $14
		addi $12, $12, 4
continuar:		nop
		
		lui $25, 0xffff			#Reg $25 guarda meu keyboard
		lw  $13, 4($25)			#Valor guardado no reg $13. 
		addi $15, $0, 's'			#'S' será responsável por iniciar a minha cronometragem 
		beq $13, $15, iniciarContagem		
		addi $15, $0, 'a'			#'A' responsável por mover para a direita
		beq $13, $15, esquerda
		addi $15, $0, 'd'			#'D' para a esquerda
		beq $13, $15, direita
		addi $15, $0, 'p'			#'P' para atirar
		beq $13, $15, atirar
continuar2:		
	
		j start
	


alien_posição:	addi $12, $0, 5180			#Reiniciando a posição do meu alien
		addi $14, $0,  5580	
		j continuar

iniciarContagem:	
		.include "Barra_Laranja.asm"
		jal perdeu
		
esquerda:		lui $9, 0x1001
		add $9, $9, $11			#Pixel da parte de cima da nave
